import React from "react";

function Miscellaneous() {
  return (
    <div style={{ padding: 20 }}>
      <h1>Miscellaneous</h1>
      <p>For items that do not fit other categories, check local recycling options.</p>
    </div>
  );
}

export default Miscellaneous;
